import React from 'react';
import './App.css';

import {Container, Row, Col} from "react-bootstrap";
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

import NavigationBar from "./components/NavigationBar";
import Welcome from "./components/Welcome";
import Footer from "./components/Footer";
import AddHotel from "./components/AddHotel";
import HotelList from "./components/HotelList";

function App() {

    const marginTop = {
      marginTop:"20px"
    };

  return (
    <Router>
        <NavigationBar/>
        <Container>
            <Row>
                <Col lg={12} style={marginTop}>
                    <Switch>
                        <Route path="/" exact component={Welcome}/>
                        <Route path="/addHotel" exact component={AddHotel}/>
                        <Route path="/hotelList" exact component={HotelList}/>
                        <Route path="/addGuest" exact component={HotelList}/>
                        <Route path="/guestList" exact component={HotelList}/>
                        <Route path="/addReservation" exact component={HotelList}/>
                        <Route path="/reservationList" exact component={HotelList}/>
                        <Route path="/addRoom" exact component={HotelList}/>
                        <Route path="/roomList" exact component={HotelList}/>
                        <Route path="/addWorker" exact component={HotelList}/>
                        <Route path="/workerList" exact component={HotelList}/>
                    </Switch>
                </Col>
            </Row>
        </Container>
        <Footer/>
    </Router>
  );
}

export default App;
